SELECT EGD.RFC, EGD.NAME, ER.NUMEXP, ER.TRADE_NUMBER, ER.FOLIO_DATE, EE.FOLIO_INDUCTION
FROM EIAFI_RESOLUTIVE ER 
JOIN EIAFI_EVALUATION EE ON EE.NUMEXP = ER.NUMEXP
JOIN EIAFI_GENERAL_DATA EGD ON EGD.NUMEXP = ER.NUMEXP
JOIN TRANSACT T ON EGD.NUMEXP = T.id;